import React from 'react';
import ExperienceItem from '../components/ExperienceItem'; // Adjust the path as needed
import '../styles/Experience.css' // Adjust the path as needed

const Experience = () => {
  // Sample experience data (replace with your actual data)
  const experiences = "From Neopets avatar customization to building real-world tech, a B.S. in Software Engineering and minor in Digital Technology fueled my passion to explore the design side of code. My internships started with building a health check monitor for microservices at Eagleview.  At Liberty Mutual, I merged code and design by crafting a landing page and icons for their Mainframe team. Chase Cost Management saw me tackle user interfaces and build a client portal.  Poatek IT Consulting had me automating project tracking with APIs, and finally, at Inward, I streamlined data analysis. Now, I'm ready to leverage this diverse experience to create dope, user-friendly tech solutions."

  return (
    <div className="experience-page">
      {experiences.map((experience, index) => (
        <ExperienceItem key={index} {...experience} />
      ))}
    </div>
  );
};

export default Experience;
